import aggregateTests from "./aggregateTests";
function createFormattedTests(data, aggTime) {
  let len = data.regions.length;
  for (let i = 0; i < len; i++) {
    const region = data.regions[i];
    data[region].tests = aggregateTests(data[region].rawTests, aggTime);
  }
  return data;
}

export default {createFormattedTests};
